const SearchNew = () => {
  return (
    <div class='row'>
      <h3>SearchNew</h3>
      <form class='col s12'>

          <div class='input-field col s6'>
            <input
              placeholder='Placeholder'
              id='first_name'
              type='text'
              class='validate'
            />
            <label for='first_name'>First Name</label>

        </div>
      </form>
    </div>
  );
};

export default SearchNew;
